#root.root {--tabs-height: 40px;}
#root.root {--tabs-inner-gap: 5px;}
#root.root {--nav-btn-height: 25px;}

/* Dynamic Sidebery (v12024.05.15) by Drannex42 (https://github.com/drannex42/FirefoxSidebar) */

#root.root {--tabs-font: 0.85rem sans-serif;}

#root.root {--tabs-margin: 10px;} /* Centers the tabs on sidebar close */
 /* Modify this to center the icons better */

#root.root {--nav-height-padding: 1px} /* Modify this to reduce or increase the navbars bottom/top margin */
 /* Modifies the navbar button height */
#root.root {--nav-margin: 11px;} /* Modifies the navbar button height */

#root.root {--tabs-text-padding-left: 6px;} /* Modify this to change the spacing between the icon and title */
#root.root {--tabs-margin-bottom: -1px;} /* Modify this to change the spacing between tabs Default: -2px */

/* Minimized Sidebar */
@media screen and (max-width: 60px) {
  #root {
    --tabs-indent: unset !important;
  }

  .container {
      max-width: 60px;
  }

   .Tab .title {
      display: none;
   }

   .NavigationBar .nav-item#settings, .NavigationBar .main-items {
      display: none;
    }
}

/* Navbar */

#root .NavigationBar {
padding: var(--nav-height-padding) var(--nav-margin);
margin-bottom: 10px !Important;
}

/* Tab Display Settings */

.Tab {
margin-bottom: var(--tabs-margin-bottom) !important;
}

.Tab .title {
padding-left: var(--tabs-text-padding-left);
}

.Tab .ctx {
left: 0px; /* This sets the container indicator border-color to the left, instead of the right */
}

/* Audio Button Settings */

.Tab[data-audible="true"] .audio, .Tab[data-muted="true"] .audio, .Tab[data-paused="true"] .audio {
background: var(--tabs-normal-bg);
left: 11px;
height: unset;
bottom: 7px;
top: unset;
}

.Tab[data-audible="true"] .t-box .title, .Tab[data-muted="true"] .t-box .title, .Tab[data-paused="true"] .t-box .title {
--audio-btn-offset: 0px !important;
}


/* End Dynamic Sidebery */

/* Tip: Copy & place your modifications to the dynamic tab variables below for easier upgrading
 * Example: #root.root {--tabs-margin-bottom: -2px;}
*/
